import React, { Component } from 'react';
import './Hero.css'

class Hero extends Component {
    render() {
        return (
            <div id="hero">
                <div id="fullstack-text">FULL-STACK</div>
                <div>SOFTWARE</div>
                <div>DEVELOPER</div>
                {/* <p id="hero-welcome"><span >FULL-STACK</span>SOFTWARE DEVELOPER</p> */}
            </div>
        );
    }
}

export default Hero;
